import React from "react";
import '../style.css';
import Pages from '../Routes';


export const Nav = () => {
    return (
        <div>
            <div className="Navigation">
                <ul>
                    <li>ABOUT</li>
                    <li>CONTACT</li>
                    <li>PROJECTS</li>
                </ul>
            </div>
        </div>
    )
};

const Home = () => {
    return (
        <div className="Home">
            <div className="leftPanel">
                <div className="Logo">RAFEEQ WEIDEMAN</div>
                <div className="pages">
                    <ul>
                        <li>Welcome</li>
                        <li>About Me</li>
                        <li>What I Do</li>
                        <li>Get In Touch</li>
                    </ul>
                </div>
            </div>

            <div className="rightPanel">
                <Nav />
                <div className="content">
                   <Pages /> 
                </div>
            </div>
        </div>
    )
}

export default Home;
